PRJ_CONTENTFR:
Examiner la situation relative à l'égalité entre les femmes et les hommes dans la société européenne et suivre son évolution; promouvoir  l'égalité de la femme et de l'homme en tant que condition essentielle de la DEMOCRATIE
Voir aussi Conseil de l'Europe et Comite Directeur sur la démocratie locale et régionale 

- à cette fin, recueillir des données, procéder à des analyses, études et évaluations, confronter les politiques nationales et mettre en commun les expériences, définir les stratégies et les mesures de politique concertée ainsi que les instruments en vue de la mise en oeuvre des principes régissant le domaine de l'égalité et, si nécessaire, élaborer des instruments juridiques et autres appropriés; 

- préparer les conférences ministérielles européennes sur l'égalité entre les femmes et les hommes et en assurer le suivi, compte tenu des décisions du Comité des Ministres à cet égard; 

AUTORITES - AUTORITES (DIVERS) Le Comité Directeur sur l'Egalité des Chances hommes/femmes
